//SPDX-License-Identifier: MIT
pragma solidity ^0.6.9;

import "./Cube.sol";
import "../contracts/interfaces/SafeMathUpgradeable.sol";
import "../contracts/interfaces/BEP20/IBEP20.sol";

contract POOL is Cube {
    using SafeMathUpgradeable for uint256;
    IBEP20 token;
    mapping(address => uint256) public liquidity;

    address WBNB = 0xbb4CdB9CBd36B01bD1cBaEBF2De08d9173bc095c;
    IBEP20 private WBNBtoken = IBEP20(WBNB);
    bool invested;
    address payable strategy;

    constructor() public payable {
        admins[msg.sender] = true;
        invested = false;
    }

    function init(uint256 WBNBtokens) public payable returns (uint256) {
        require(WBNBtoken.transferFrom(msg.sender, address(this), WBNBtokens));
        uint256 totalLiquidity = WBNBtoken.balanceOf(address(this));
        liquidity[msg.sender] = totalLiquidity;

        return totalLiquidity;
    }

    function price(
        uint256 input_amount,
        uint256 input_reserve,
        uint256 output_reserve
    ) public view returns (uint256) {
        uint256 input_amount_with_fee = input_amount.mul(997);
        uint256 numerator = input_amount_with_fee.mul(output_reserve);
        uint256 denominator =
            input_reserve.mul(1000).add(input_amount_with_fee);
        return numerator / denominator;
    }

    function getWBNB() public view returns (uint256) {
        return WBNBtoken.balanceOf(address(this));
    }

    function getToken() public view returns (uint256) {
        return token.balanceOf(address(this));
    }

    function getLiquidity() public view returns (uint256) {
        return WBNBtoken.balanceOf(address(this));
    }

    function setInvested(bool investmentStatus) public returns (bool) {
        require(
            (admins[msg.sender] == true) || (msg.sender == strategy),
            "POOL: only an appropriate sender can do this"
        );
        invested = investmentStatus;
        return invested;
    }

    function setStrategy(address payable newStrategy)
        public
        onlyAdmin
        returns (address)
    {
        strategy = newStrategy;
        return strategy;
    }

    function getStrategy() public view returns (address) {
        return strategy;
    }

    function gettInvested() public view returns (bool) {
        return invested;
    }

    function depositLiquidity(uint256 WBNBtokens) public payable {
        require(WBNBtoken.transferFrom(msg.sender, address(this), WBNBtokens));
    }

    function withdrawLiquidity() public onlyAdmin {
        uint256 wbnbValue = WBNBtoken.balanceOf(address(this));
        WBNBtoken.transferFrom(address(this), msg.sender, wbnbValue);
    }

    function Invest() public {
        uint256 totalLiquidity = WBNBtoken.balanceOf(address(this));
        require(
            msg.sender == strategy || admins[msg.sender] == true,
            "POOL: only strategy or admin can invest"
        );
        WBNBtoken.transferFrom(
            address(this),
            strategy,
            WBNBtoken.balanceOf(address(this))
        );
        invested = true;
    }
}
